In the most basic scenario, Yarner extracts code blocks from a Markdown document and writes them to an equally-named file in the code output directory, with the file's md extension stripped off. As an example, create a project like this: > yarner init This creates a file README.md in your project's directory, and a Yarner.toml file with the default settings. File README.md has some template content, but we want to start with a minimal example: # Simple example The program's entry point: ```rust
fn main() { println!("Hello World!");
}
``` Running Yarner with > yarner creates a file README in sub-directory code, and a documentation file README.md in sub-directory docs. In this case, docs/README.md has the same content as the original file, and code/README contains the extracted code block: fn main() { println!("Hello World!");
}

