To allow structuring for humans, Yarner uses macros. For that sake, code blocks can be given a name in their first line, by default prefixed with //-. Here is a code block named Say hello: ```rust
//- Say hello
fn say_hello() { println!("Hello World!");
}
``` During code extraction, code is drawn together by replacing macro invocations by the respective code block's content. By default, a macro invocation starts with // ==> and ends with .. ```rust
fn main() { say_hello();
} // ==> Say hello.
``` As a complete example, the content of a file main.rs.md could look like this: # Simple example The program's entry point: ```rust
fn main() { say_hello();
}
// ==> Say hello.
``` Here is how we say hello: ```rust
//- Say hello
fn say_hello() { println!("Hello World!");
}
``` The resulting content of code/main.rs looks like this: fn main() { say_hello();
}
fn say_hello() { println!("Hello World!");
} Macro evaluation is recursive. Thus, code blocks that are referenced by macros can also contain macro invocations.

