It is possible to generate multiple code files from a single documentation source file through code blocks named with file paths, prefixed with file: (the default, configurable). ```rust
//- file:path/to/file.ext
...
``` As an example, a file main.rs.md with the following content creates file src/lib.rs, besides the main file main.rs: # Multiple files example File main.rs looks like this: ```rust
fn main () { }
``` And here is the content of file `lib.rs`: ```rust
//- file:src/lib.rs
fn first_funtion() {}
fn second_funtion() {} // ==> Further functions.
``` The remaining functions in `lib.rs`: ```rust
//- Further functions
fn third_funtion() {}
fn fourth_funtion() {}
``` Note that macro invocations are possible as usual, with no special syntax required. Each code block named with the file: prefix is treated as separate entrypoint during the build process.

