This feature can also be used to avoid the somewhat uncommon file naming patterns that were used in this guide so far. We generated code files from source files of the same name, but with an additional md extension. With the file: prefix feature, it is possible to circumvent this restriction completely. As an example, it may be desired that the primary documentation file is named README.md (because the project is hosted on GitHub or GitLab), but to create a file main.rs from it. A file README.md with the following content would achieve that: # Simple example The program's entry point: ```rust
//- file:main.rs
fn main() { println!("Hello World!");
}
``` Thus, file naming in documentation and code can be completely independent of each other.

