Code blocks like examples may be intended to be excluded from code output. This can be achieved by giving a block a name that is not used in any macro. In this example, the code block named Example will be absent from the generated code as it is not referenced from anywhere: # Dead code example A function to greet someone: ```rust
fn say_hello(name: &str) { println!("Hello {}", name);
}
``` Function `say_hello_to` can be used like that: ```rust
//- Example
fn say_hello("Paul");
``` Additionally, if the option entrypoint in section [paths] of the Yarner.toml is set, unnamed blocks are excluded from code output. This can be useful to ignore e.g. simple command line usage examples intended to instruct the reader rather than for code output.

