Sometimes, it can be useful to exclude code that is of limited interest for the reader from documentation output. This can be achieved by prefixing block names with hidden: (the default, configurable): ```rust
//- hidden:A hidden function
fn hidden() { }
``` For code output, hidden blocks are treated like regular code blocks. Only named code blocks can be hidden. The prefixes hidden: and file: can be combined, but only in that order: ```rust
//- hidden:file:secrets.rs
fn hidden() { }
``` Also note the features for Links and transclusions and for Copying files . It is not necessary to have all code in the main document, nor to have it in Markdown code blocks at all.

