Code in output intended for the reverse mode is labelled to allow Yarner to identify its file and code block of origin. You can edit everything between labels, but do not modify or delete the labels themselves! As an example, a simple Markdown source file main.rs.md could have the following content: # Simple example The program's entry point: ```rust
fn main() { // ==> Say hello.
}
``` Here is how we say hello: ```rust
//- Say hello
println!("Hello World!");
``` With language settings for Rust as given above, the generated code in main.rs looks like this: // <@main.rs.md##0
fn main() { // <@main.rs.md#Say hello#0 println!("Hello World!"); // @>main.rs.md#Say hello#0
}
// @>main.rs.md##0

