When the same code block is use by multiple macro invocations, it is ambiguous which one to play back into the sources. Here is an example: fn main() { // ==> Say hello. // ==> Say hello.
} In such cases, Yarner emits a warning when called with subcommand reverse. If the occurrences differ, like in the following example of user-modified code output, it aborts with an error. // <@main.rs.md#
fn main() { // <@main.rs.md#Say hello#0 println!("Hello World!"); // @>main.rs.md#Say hello#0 // <@main.rs.md#Say hello#0 println!("Hello Universe!"); // @>main.rs.md#Say hello#0
}
// @>main.rs.md#

