To use the Rust crate yarner-lib to write plugins, add it to the dependencies of your Cargo.toml: [package]
... [dependencies]
yarner-lib = "0.5"
... Besides the structs that make up a document, the library offer some convenience functions for JSON conversion. Here is an example plugin that adds a simple text paragraph to the end of each document: use yarner_lib::*; fn main() { std::process::exit(match run() { Ok(()) => 0, Err(err) => { eprintln!("ERROR: {}", err); 1 } });
} fn run() -> Result<(), Box<dyn std::error::Error>> { // Get documents from stdin JSON let mut data = yarner_lib::parse_input()?; // Get options from the plugin's section in the Yarner.toml let _foo = data.context.config.get("foo").unwrap(); // Manipulate documents for (_path, doc) in data.documents.iter_mut() { doc.nodes.push(Node::Text(TextBlock { text: vec![ String::new(), String::from("Edited by an example plugin."), ], })); } // Convert documents back to JSON and print them to stdout yarner_lib::write_output(&data)?; Ok(())
} See the Known plugins for more complex code examples.

